(20, '27.03.2023', 'Exchange Policy', 'public/uploads/exchanged Policy.jpg', 'Exchange Policy', '<p>আমাদের এক্সচেঞ্জ পলিসি আপনি কিভাবে গ্রহন করতে পারবেন। (রেডেক্স এর ক্ষেত্রে)</p><p>প্রডাক্ট পাবার পর অবশ্যই সেটা গ্রহন করিতে হবে। এর পর সেটার যদি সাইজ/ডিফেক্ট/ভুল প্রডাক্ট এই জাতীয় সমস্যা থাকে তাহলে পেইজ এ জানাবেন। পেইজ পরের দিন ই আপনার প্রডাক্ট এক্সচেঞ্জ করে দিবে। কিন্তু আপনারা যদি প্রডাক্ট রিছিভ না করেন সেক্ষেত্রে এক্সচেঞ্জ করে দেয়ার সুযোগ নেই ।</p><p>অনেক ক্ষেত্রে দেখা যায় প্রডাক্ট পাবার পর চেক করে এবং কাস্টমার এর কোন এক সমস্যা হলে সেটা তখন ই ডেলিভারি লোক কে দিয়ে দেয় এতে আমাদের এক্সচেঞ্জ এর পলিসি টা থাকেনা এর জন্য প্রডাক্ট রিছিভ করার পর ত্রুটি থাকলে তখন আমাদের পেইজ এ জানাবেন।</p><p>এক্সচেঞ্জ ফি :কাস্টমার কেন্দ্রিক কোন ভুল হলে এক্সচেঞ্জ ফি কাস্টমার বহন করবে।</p><p>ঢাকায় এক্সচেঞ্জ ফি ৭০ টাকা</p><p>সাবজোন ১১০ টাকা</p><p>আউটসাইট ঢাকা ১৪০ টাকা</p><p>আর যদি ভুল টা আমাদের হয় সেক্ষেত্রে আমরা এক্সচেঞ্জ ফি বহন করিতে বাধ্য থাকিবো।</p><p>একচেঞ্জ এর সময়কাল : প্রডাক্ট গ্রহন করার ৪৮ ঘন্টার এর ভেতর প্রডাক্ট এর সমস্যা হলে জানাতে হবে। ৪৮ ঘন্টার পর আমরা কোন রকম প্রডাক্ট এক্সচেঞ্জ এর প্রসেস করতে পারবোনা।</p><p>আর আমাদের প্রডাক্ট রিটার্ন করার কোন অপশন নেই।</p>', 'superadmin', '2022-12-28 11:02:13', '2023-03-27 17:34:48'),
